import React from 'react';
import {
    BrowserRouter as Router,
    Route,
    Switch,
    link
} from 'react-router-dom';

export default function RouterApp() {
    return (
        <Router>
            <Router path="/">
                <h3>Home</h3>
            </Router>
            <Router path="/acerca">
                <h3>Acerca</h3>
            </Router>
            <Router path="/contacto">
                <h3>Contacto</h3>
            </Router>
        </Router>
    );
}
